import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getPopular } from "../../store/film/filmSlice";
import './dashboard.css';


function Dashboard() {

    const dispatch = useDispatch();
    const popularMovie = useSelector((state) => state.film)

    useEffect(() => {
        dispatch(getPopular())
    }, []);
    console.log(popularMovie.data.results)
    return <div>
        {popularMovie.data.results.map((e, i) => {
            return (
                <div>
                    <p>{e.adult}</p>
                </div>
            )
        })}

    </div>
}

export default Dashboard
